import "./Detail.css";
import {useState} from 'react'

const Detail = () => {
const [coinData,setCoinData]=useState();

  const fetchCoinDetails = async () => {
    try {
      const { data } = await new Promise((res) => {
        setTimeout(() => {
          res(axios.get(SingleCoin()));
        }, 10);
      });
      setCoinData(data);
    } catch (err) {
      console.error(err);
    }
  };

  return <div></div>;
};
export default Detail;
